function Projects() {
  const Project = [
    {
      title: "Project 1",
      decription:
        "Lorem ipsum odor amet, consectetuer adipiscing elit. Ac purus in massa egestas mollis variusdignissim elementum. Mollis tincidunt mattis hendrerit dolor eros enim, nisi ligula ornare Hendrerit parturient habitant pharetra rutrum gravida porttitor eros feugiat. Mollis elit sodales taciti duis praesent id. Consequat urna vitae morbi nunc congue.",
    },
  ];
  return (
    <div>
      <h1>Fetured Projects and Content</h1>

      {Project.map((project, index) => (
        <div key={index}>
          <div className="">
            {project.title}
            {project.description}
            <a
              href={project.link}
              className="btn btn-danger"
              target="_blank"
              rel="noopener noreferrer"
            >
              View Project
            </a>
          </div>
        </div>
      ))}
    </div>
  );
}

export default Projects;
